import React from "react";
import group7left from "../../images/footer/group7left.webp";
import group7right from "../../images/footer/group7right.webp";
import footerLeft from "../../images/footer/footerLeft.webp";

const Footer = () => {
  return (
    <div className="bg-[#313244] text-center">
      <div className="flex mx-4 space-x-10">
        <div className="w-1/3">
          <img className="w-[70px]" src={group7left} alt="" />
          <img src={footerLeft} alt="" />
        </div>
        <div>
          <p className="text-white">Licensed By WeAbove</p>
        </div>
        <div className="w-1/3">
          <img className="w-[70px] " src={group7right} alt="" />
          <img src={footerLeft} alt="" />
        </div>
      </div>
      <span className="text-[#fc4a6a]">Terms & Conditions</span>
    </div>
  );
};

export default Footer;
